    }
    render() {
        return (
            <div className="Main">
                <div className = "text-container">
                <Link className = "text" to = '/' style={{ textDecoration: 'none' }}>
                    <h1> food-reviewer </h1>

                </Link>
                </div>
                <BigSearchBar/>

            </div>
        );
    }

}

export default Main;
